// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IAnySwap { // anysawpout 함수호출후 값이 들어감. 함수 형태만 정의한거임 인터페이스 정의는 인자는 실제 함수 호출시 전달
    function anySwapOut(address asset, address to, uint value, uint toChainID) external;
}

contract CrossSwapContrat { // 변수선안
    address public owner;  // 스마트 계약의 소유자 주소를 저장할 변수
    uint256 public gasThreshold; // 가스비 임계값 저장
    IAnySwap public anyswap;      //anyswap과 상호작용하는 스마트계약의 주소 저장 인터페이스#IAnySwap#로 타입지정했으므로

    event GasPriceHigh(uint256 gasPrice, string action);

    constructor(address _anyswap, uint256 _gasThreshold) {   // 생성자 함수
        owner = msg.sender;       //이 계약의 소유자는 이 계약을 배포하는 사람의 주소
        gasThreshold = _gasThreshold;   // 배포시 입력받은 임계값
        anyswap = IAnySwap(_anyswap); // Anyswap 컨트랙트 주소 연결
    }

    // 가스비를 체크하고, 크로스체인 스왑 트리거
    function checkGasAndSwap(address asset, address to, uint256 value, uint256 toChainID) public {
        uint256 currentGasPrice = tx.gasprice;
        require(currentGasPrice > gasThreshold, "Gas price too low");

        emit GasPriceHigh(currentGasPrice, "Swapping Assets");
        anyswap.anySwapOut(asset, to, value, toChainID); // Anyswap호출로 자산 이동// 애니스왑 프로토콜에 정의된 함수 자산을 다른 체인으로 스왑
    }

    // 가스비 임계값 업데이트
    function updateGasThreshold(uint256 _gasThreshold) public {
        require(msg.sender == owner, "Only owner can update");
        gasThreshold = _gasThreshold;
    }
}
